import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Navbar from "./components/View/Navbar";
import Footer from "./components/View/Footer";
import Home from "./components/View/Home";
import Dashboard from "./components/Dashboard/Dashboard";
import ArtistDetail from "./components/View/ArtistDetail";
import Favorites from "./components/View/Favorites";
import Venues from "./components/View/Venues";
import VenueDetail from "./components/View/VenueDetail";
import "./App.css";
import "./index.css";
import Unauthorized from "./components/Dashboard/Unauthorized";
import ProtectedRoute from "./components/Dashboard/ProtectedRoute";
import { AuthProvider } from "./context/AuthContext";
import Jobs from "./components/View/Jobs";
import InstantBookModal from "./components/View/InstantBookModal";

import Login from "./components/Login";

const App = () => {
  const [show, setShow] = React.useState(false);

  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);

  return (
    <AuthProvider>
      <div className="App">
        <Router>
          <Navbar handleShow={handleShow} />
          <InstantBookModal show={show} handleClose={handleClose} />
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/login" element={<Login />} />

            <Route
              path="/dashboard"
              element={
                <ProtectedRoute>
                  <Dashboard />
                </ProtectedRoute>
              }
            />
            <Route path="/unauthorized" element={<Unauthorized />} />

            <Route path="/artist/:id" element={<ArtistDetail />} />
            <Route path="/favorites" element={<Favorites />} />
            <Route path="/venues" element={<Venues />} />
            <Route path="/venuedetail/:id" element={<VenueDetail />} />
            <Route path="/jobs" element={<Jobs />} />
          </Routes>

          <Footer />
        </Router>
      </div>
    </AuthProvider>
  );
};

export default App;
